import React from 'react';

const Admin = () => {
    return (
        <div>
            <div className="bodypage">
                <a
                    className="App-link"
                    href="https://vk.com/impartialman"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    My VK
                </a>
            </div>
        </div>

    );
};

export default Admin;
